-- ----------------------------
-- Table structure for `goods`
-- ----------------------------
DROP TABLE IF EXISTS `goods`;
CREATE TABLE `goods` (
  `id` char(13) COLLATE utf8mb4_bin NOT NULL COMMENT '主键 13位字符 关联其他表',
  `name` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '商品名称  模糊查询会用到',
  `created` datetime NOT NULL COMMENT '创建时间 商品的上架时间',
  `creator` char(13) COLLATE utf8mb4_bin NOT NULL COMMENT '创建人 ',
  `goods_type_id` char(13) COLLATE utf8mb4_bin NOT NULL COMMENT '该商品属于哪个分类下面 哪个终极分类(不可再分的类别)',
  `content` longtext COLLATE utf8mb4_bin COMMENT '文本描述 该商品的详情介绍 可以很长 ',
  `is_disabled` bit(1) NOT NULL COMMENT '是否下架 并非删除 是由于供货等原因 暂时下架 有以后重新上架的可能',
  `updated` datetime DEFAULT NULL COMMENT '商品的修改时间 可以为空 意思为商品上架后就没人动 如果有人修改该商品扩展表的规格内容 则更新时间',
  `updator` char(13) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '更新的人是谁,是谁修改的数据,便于管理 删除也属于更新 所以取消删除人字段',
  `brand_id` char(13) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '关联品牌表 代表该产品是什么牌子的  我认为产品应该 都有品牌 不然就是三无产品嘛 ',
  `is_tops` bit(1) DEFAULT NULL COMMENT '是否置顶 true(1) 置顶 false(0) 不置顶',
  `views` int(11) DEFAULT NULL,
  `freight` decimal(10,2) DEFAULT '0.00' COMMENT '运费 不可为空 必填',
  PRIMARY KEY (`id`),
  KEY `IXFK_goods_brand` (`brand_id`),
  KEY `IXFK_goods_goods_type` (`goods_type_id`),
  KEY `IXFK_goods_user` (`creator`),
  KEY `IXFK_goods_user_02` (`updator`),
  CONSTRAINT `FK_goods_brand` FOREIGN KEY (`brand_id`) REFERENCES `brand` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_goods_goods_type` FOREIGN KEY (`goods_type_id`) REFERENCES `goods_type` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_goods_user` FOREIGN KEY (`creator`) REFERENCES `user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_goods_user_02` FOREIGN KEY (`updator`) REFERENCES `user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='商品表';

-- ----------------------------
-- Records of goods
-- ----------------------------

-- ----------------------------
-- Table structure for `goods_comment`
-- ----------------------------
DROP TABLE IF EXISTS `goods_comment`;
CREATE TABLE `goods_comment` (
  `id` char(13) COLLATE utf8mb4_bin NOT NULL COMMENT '主键 自关联时自己关联自己',
  `member_id` char(13) COLLATE utf8mb4_bin NOT NULL COMMENT '会员id 评论该商品的人是谁',
  `parent_id` char(13) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '父类是谁 如果是买家的评论 那就为 0  是店家的回复 这里就填 回复的那条评论的id',
  `goods_id` char(13) COLLATE utf8mb4_bin NOT NULL COMMENT '商品的id  这些评论 还有回复 是针对哪个商品的',
  `content` varchar(200) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '评论的内容是什么  可以带图 内容数字也有上线',
  `is_answered` bit(1) DEFAULT NULL COMMENT '是否已回复 买家的评论 店家是否回复  false 未回复 true 已回复',
  `is_auditd` bit(1) DEFAULT NULL COMMENT '是否审核 true 审核过关  false 未审核 评论需审核过后才可以显示',
  `is_disabled` bit(1) NOT NULL COMMENT '是否隐藏该评论 false 显示 true 隐藏',
  `created` datetime NOT NULL COMMENT '该评论的创建时间',
  `goods_extend_id` char(13) COLLATE utf8mb4_bin NOT NULL COMMENT '关联报价表 获取所购买的报价信息 ',
  `score` char(1) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '商品品论的打分状态  分三等 优(0) 良(1) 差(2) 前端显示名称可换  ',
  PRIMARY KEY (`id`),
  KEY `IXFK_goods_comment_goods_extend` (`goods_extend_id`),
  KEY `IXFK_goods_talk_goods` (`goods_id`),
  KEY `IXFK_goods_talk_user` (`member_id`),
  CONSTRAINT `FK_goods_comment_goods_extend` FOREIGN KEY (`goods_extend_id`) REFERENCES `goods_extend` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_goods_talk_goods` FOREIGN KEY (`goods_id`) REFERENCES `goods` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_goods_talk_user` FOREIGN KEY (`member_id`) REFERENCES `user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='商品的评论表 最多两级  买家评论一次 店家回复一次';

-- ----------------------------
-- Records of goods_comment
-- ----------------------------

-- ----------------------------
-- Table structure for `goods_extend`
-- ----------------------------
DROP TABLE IF EXISTS `goods_extend`;
CREATE TABLE `goods_extend` (
  `id` char(13) COLLATE utf8mb4_bin NOT NULL DEFAULT '0' COMMENT '主键 ',
  `goods_id` char(13) COLLATE utf8mb4_bin NOT NULL COMMENT '商品id 外键关联商品表的id',
  `sales` int(11) NOT NULL COMMENT '销售量  该商品卖出去多少件 可把销售量与浏览量的比值作为热度 进行排名 以确定热销产品的先后顺序',
  `originalprice` decimal(10,2) NOT NULL COMMENT '开始时的价格(原价) 用来促销打折活动的时候 用户直观的看到降价',
  `price` decimal(10,2) NOT NULL COMMENT '现在的价格 (现价) 和原价搭配使用 如果和原价一样 那就普通显示',
  `is_defaults` bit(1) NOT NULL COMMENT '该规格是不是默认规格,意思为查询商品列表的时候 显示的图片和价格是哪个',
  `stock` int(11) NOT NULL COMMENT '库存 定制产品的话 库存固定写死 普通商品有库存 库存的真正使用地方时买规格的时候 选的规格是否显示',
  `options` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '不可为null 即使只有一个 通码通号 也要有一个通码通号选项',
  `bigimage` varchar(100) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '该种规格的大图',
  `smallimage` varchar(100) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '该种规格的小图',
  `state` char(1) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '0 正常 1 删除 2 禁用',
  PRIMARY KEY (`id`),
  KEY `IXFK_goods_extend_goods` (`goods_id`),
  CONSTRAINT `FK_goods_extend_goods` FOREIGN KEY (`goods_id`) REFERENCES `goods` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='商品的扩展表 存放不直观看到的数据';

-- ----------------------------
-- Records of goods_extend
-- ----------------------------

