  `id` char(13) COLLATE utf8mb4_bin NOT NULL COMMENT '主键 用来关联其他表',
  `name` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '分类的名称  如 家具→床→婴儿床  像这样的每种都是一行数据                       →双人床',
  `sort` int(11) NOT NULL COMMENT '排序 用在显示或者商品展示的时候的显示顺序',
