  CONSTRAINT `FK_microblog_comment_microblog_id` FOREIGN KEY (`microblog_id`) REFERENCES `microblog` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_microblog_comment_parent_creator_user_id` FOREIGN KEY (`parent_creator`) REFERENCES `user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
