-- ----------------------------
-- Table structure for `order`
-- ----------------------------
DROP TABLE IF EXISTS `order`;
CREATE TABLE `order` (
  `id` char(13) COLLATE utf8mb4_bin NOT NULL COMMENT '主键，系统生成 ',
  `order_number` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '订单编号',
  `member_id` char(13) COLLATE utf8mb4_bin NOT NULL COMMENT '会员ID',
  `paid_price` decimal(20,2) DEFAULT NULL COMMENT '支付金额',
