  `freight` decimal(20,2) NOT NULL COMMENT '运费',
  `paid_method` tinyint(4) NOT NULL COMMENT '支付类型',
  `descr` varchar(200) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '订单备注',
  `status` tinyint(4) NOT NULL COMMENT '订单状态(0未付款1已付款2部分发货3已发货4已收货5已撤销6已退款)\r\n',
  `receipt_id` char(13) COLLATE utf8mb4_bin NOT NULL COMMENT '用户地址ID',
  `trade_no` char(13) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '商户系统内部订单号',
  `created` datetime DEFAULT NULL COMMENT '创建时间',
  `updated` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `IXFK_order_address` (`receipt_id`),
  KEY `IXFK_order_user_id` (`member_id`),
  CONSTRAINT `FK_order_address_id` FOREIGN KEY (`receipt_id`) REFERENCES `address` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_order_user_id` FOREIGN KEY (`member_id`) REFERENCES `user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='订单表';

