  `company_id` char(13) COLLATE utf8mb4_bin NOT NULL COMMENT '公司id',
  `event` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '活动事件：来源于SystemActivityEvent.java',
  `created` datetime NOT NULL COMMENT '创建时间',
  `creator` char(13) COLLATE utf8mb4_bin NOT NULL COMMENT '操作人id',
  `r1` char(13) COLLATE utf8mb4_bin NOT NULL COMMENT '所操作资源的id',
  `r2` char(13) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '所操作资源的父资源id',
  `r3` longtext COLLATE utf8mb4_bin COMMENT '所操作的资源内容',
  `scope` tinyint(4) NOT NULL COMMENT '资源范围：来源与ResourceScope.java的定义',
  PRIMARY KEY (`id`),
  KEY `IXFK_system_activity_company` (`company_id`),
