  `welcome` varchar(300) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '进入微信时候的欢迎语',
  `company_id` char(13) COLLATE utf8mb4_bin NOT NULL,
  `wxmenus` varchar(1000) COLLATE utf8mb4_bin DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `IXFK_system_config_company` (`company_id`),
  CONSTRAINT `FK_system_config_company` FOREIGN KEY (`company_id`) REFERENCES `company` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
