CREATE TABLE `tag` (
  `id` char(13) COLLATE utf8mb4_bin NOT NULL COMMENT '主键 作为外键和其他表关联',
  `name` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '名称  该标签的名称',
  `color` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '颜色  不同标签可以有不同的颜色',
  `is_disabled` bit(1) NOT NULL COMMENT '该标签是够隐藏 显示 false 隐藏 true ',
