-- ----------------------------
-- Table structure for `upload_files`
-- ----------------------------
DROP TABLE IF EXISTS `upload_files`;
CREATE TABLE `upload_files` (
  `id` char(13) COLLATE utf8mb4_bin NOT NULL COMMENT '主键',
  `resource_id` char(13) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '所属资源id，比如商品、商品评论、',
  `resource_type` tinyint(4) NOT NULL COMMENT '文件的所属资源类型：0-系统配置;1-商城配置;2-商品;3-商品评论;4-快享;5-商品规格;6-品牌;7-用户相关（头像、桌面背景等）8-背景图片,9-商品展示图片;',
  `path` varchar(100) COLLATE utf8mb4_bin NOT NULL COMMENT '文件的访问路径，带域名的全路径，如：http://localhost:8080/resources/goods/3232233323.png',
  `name` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '文件的名称：被上传时的原始文件名',
  `mime` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '文件的mime类型（上传时根据业务逻辑而设定的）',
  `original_mime` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '文件的mime类型（原始mime）',
  `status` tinyint(4) NOT NULL COMMENT '文件状态：0 - 临时文件；1：正式文件',
  `creator` char(13) COLLATE utf8mb4_bin NOT NULL COMMENT '创建人id（上传人id）',
  `created` datetime NOT NULL COMMENT '上传时间',
  `belong_id` char(13) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '该文件对应的资源属于哪个资源的子资源：比如商品评论的图片，那么belong_id填对应的商品id，没有则为null',
  PRIMARY KEY (`id`),
  KEY `IXFK_upload_files_user_id` (`creator`),
  CONSTRAINT `FK_upload_files_user_id` FOREIGN KEY (`creator`) REFERENCES `user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='上传的文件管理表，用于文件维护，临时文件可以被清理';

-- ----------------------------
-- Records of upload_files
-- ----------------------------

-- ----------------------------
-- Table structure for `user`
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `id` char(13) COLLATE utf8mb4_bin NOT NULL COMMENT '主键ID',
  `name` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '名称，用于显示',
  `sex` tinyint(4) NOT NULL COMMENT '性别:0-男，1-女',
  `email` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '邮箱',
  `avatar` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '头像，默认为AppBeanInjector.configuration.getUserDefaultAvatar()',
  `birthday` date DEFAULT NULL COMMENT '生日',
  `mobile` varchar(20) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '联系电话',
  `state` tinyint(4) NOT NULL COMMENT '状态：0-禁用，1-启用，默认为1',
  `background` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '自定义背景图',
  `created` datetime NOT NULL COMMENT '创建时间',
  `last_login` datetime DEFAULT NULL COMMENT '最后登陆时间',
  `time_zone` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '时区',
  `language` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '语言',
  `role` tinyint(1) NOT NULL COMMENT '用户角色id',
  `username` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '用户登录名',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='客户用户表（会员）';

-- ----------------------------
-- Records of user
-- ----------------------------

-- ----------------------------
-- Table structure for `user_extra`
-- ----------------------------
DROP TABLE IF EXISTS `user_extra`;
CREATE TABLE `user_extra` (
  `user_id` char(13) COLLATE utf8mb4_bin NOT NULL,
  `salt` varchar(50) COLLATE utf8mb4_bin NOT NULL,
  `password` varchar(100) COLLATE utf8mb4_bin NOT NULL,
  `updated` datetime DEFAULT NULL,
  `token` varchar(100) COLLATE utf8mb4_bin NOT NULL,
  PRIMARY KEY (`user_id`),
  KEY `IXFK_user_extra_user_id` (`user_id`),
  CONSTRAINT `FK_user_extra_user_id` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='用户扩展信息表，存储密码等隐私信息';

-- ----------------------------
-- Records of user_extra
-- ----------------------------

-- ----------------------------
-- Table structure for `user_notify`
-- ----------------------------
DROP TABLE IF EXISTS `user_notify`;
CREATE TABLE `user_notify` (
  `id` char(13) COLLATE utf8mb4_bin NOT NULL,
  `company_id` char(13) COLLATE utf8mb4_bin NOT NULL COMMENT '公司id',
  `user_id` char(13) COLLATE utf8mb4_bin NOT NULL,
  `system_activity_id` char(13) COLLATE utf8mb4_bin NOT NULL COMMENT '系统活动日志id',
  `grouping` tinyint(4) DEFAULT NULL COMMENT '消息分组：来源于NotifyGrouping.java',
  `is_readed` bit(1) NOT NULL COMMENT '是否已读',
  `created` datetime NOT NULL COMMENT '创建时间',
  `top_time` datetime DEFAULT NULL COMMENT '消息置顶的时间',
  PRIMARY KEY (`id`),
  KEY `IXFK_user_notify_company` (`company_id`),
  KEY `IXFK_user_notify_system_activity` (`system_activity_id`),
  KEY `IXFK_user_notify_user` (`user_id`),
  CONSTRAINT `FK_user_notify_company` FOREIGN KEY (`company_id`) REFERENCES `company` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_user_notify_system_activity` FOREIGN KEY (`system_activity_id`) REFERENCES `system_activity` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_user_notify_user` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin;

-- ----------------------------
-- Records of user_notify
-- ----------------------------

-- ----------------------------
-- Table structure for `user_third_info`
-- ----------------------------
DROP TABLE IF EXISTS `user_third_info`;
CREATE TABLE `user_third_info` (
  `user_id` char(13) COLLATE utf8mb4_bin NOT NULL COMMENT '用户id，关联user表的id',
  `wx_open_id` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'openid 微信公众号的用户标识，对当前开发者帐号唯一。一个openid对应一个公众号',
  `wx_nickname` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '微信昵称',
  `wx_union_id` varchar(50) COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'unionid 微信开放平台的用户统一标识。针对一个微信开放平台帐号下的应用，同一用户的unionid是唯一的，默认设为open_id',
  `wx_is_subscribe` bit(1) NOT NULL COMMENT '是否订阅公众号，用户关注公众号时生成用户数据，该字段为1（true），当用户取消关注时，设为0（false）',
  `wx_is_bind` bit(1) NOT NULL COMMENT '微信是否绑定:0-否,1-是，默认true',
  `email_is_bind` bit(1) NOT NULL COMMENT '信箱是否绑定:0-否,1-是，不填信箱时，为false',
  `mobile_is_bind` bit(1) NOT NULL COMMENT '手机号是否绑定:0-否,1-是，不填手机号时，默认为false',
  PRIMARY KEY (`user_id`),
  KEY `IXFK_user_third_info_user_id` (`user_id`),
  CONSTRAINT `FK_user_third_info_user_id` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='第三方账号信息表，微信、钉钉等';

-- ----------------------------
-- Records of user_third_info
-- ----------------------------

-- ----------------------------
-- Table structure for `video_file`
-- ----------------------------
DROP TABLE IF EXISTS `video_file`;
CREATE TABLE `video_file` (
  `id` char(13) COLLATE utf8mb4_bin NOT NULL COMMENT '主键 13位字符',
  `video_Type_Id` char(13) COLLATE utf8mb4_bin NOT NULL COMMENT '类型列如工厂还是仓库 关联类型表',
  `created` datetime NOT NULL COMMENT '上传时间',
  `creator` char(13) COLLATE utf8mb4_bin NOT NULL COMMENT '上传人',
  `cover` varchar(100) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '封面 视频封面 可取视频里某一幕 也可和视频毫无关联  <2M',
  `is_disabled` bit(1) NOT NULL COMMENT '是否禁用 0 false 启用 1 true 禁用',
  `path` varchar(100) COLLATE utf8mb4_bin NOT NULL COMMENT '视频路径',
  `name` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '标题名称',
  `sequence` int(11) DEFAULT NULL COMMENT '排序 ',
  PRIMARY KEY (`id`),
  KEY `IXFK_video_file_user` (`creator`),
  KEY `IXFK_video_file_video_type` (`video_Type_Id`),
  CONSTRAINT `FK_video_file_user` FOREIGN KEY (`creator`) REFERENCES `user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_video_file_video_type` FOREIGN KEY (`video_Type_Id`) REFERENCES `video_type` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='视频管理表';

-- ----------------------------
-- Records of video_file
-- ----------------------------

-- ----------------------------
-- Table structure for `video_type`
-- ----------------------------
DROP TABLE IF EXISTS `video_type`;
CREATE TABLE `video_type` (
  `id` char(13) COLLATE utf8mb4_bin NOT NULL,
  `name` varchar(50) COLLATE utf8mb4_bin NOT NULL COMMENT '分类名称',
  `created` datetime NOT NULL COMMENT '创建时间',
  `creator` char(13) COLLATE utf8mb4_bin NOT NULL COMMENT '创建人',
  `is_disabled` bit(1) NOT NULL COMMENT '是否禁用 0 false 启用 1 true 禁用',
  `sequence` int(11) DEFAULT NULL COMMENT '排序',
  PRIMARY KEY (`id`),
  KEY `IXFK_video_type_user` (`creator`),
  CONSTRAINT `FK_video_type_user` FOREIGN KEY (`creator`) REFERENCES `user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='视频类型表';

